import React from 'react';
import Item from '../Item/Items';
const ItemList = ({todoItem}) => (<ul>
  <li><Item todoItem={todoItem[0]}/></li>
  <li><Item todoItem={todoItem[1]}/></li>
  <li><Item todoItem={todoItem[2]}/></li>
</ul>);
export default ItemList;
